import { useSelector, useDispatch } from 'react-redux';
import { useEffect, useState } from 'react';
// import Header from '../header';
import {createNewAccountPage} from '../pages/create-new-account-page'
import CardsList from '../cards-list';
import { Pagination } from 'antd';
import { Routes, Route, Link} from 'react-router-dom'

import './app.scss';

function App() {

    const cardListPage = <div className='body-items'>
    <CardsList />
    <Pagination defaultCurrent={1} total={50} className='body-items__pagination'/>
</div>

    return(
        <div className='body'>
            <header className='header'>
                <Link to={'/'} className='blog-name'>Realworld Blog</Link>
                <div className='header-user-information'>
                    <span className='sing-in-button'>Sign In</span>
                    <Link to={'/sing up'} className='button-sing-up'>Sign Up</Link>
                </div>

            </header>
            <Routes>
                <Route path='/' element={cardListPage} />
                <Route path='/sing up' element={createNewAccountPage} />
            </Routes>
        </div>
    )
}

export default App;
